import React, {Component} from "react";
import axios from 'axios';
import './item-view.css';

export default class ItemViewComponent extends Component{

    constructor(props) {
        super(props);
        this.state = {
            data:[]
        };
    }

    componentDidMount() {
        this.loadData();
    }

    async loadData(){
        axios.get('http://localhost:3000/items')
        .then(res =>{
            this.setState({
                data: res.data
            });
        });
    }

    tableData(){
        return this.state.data.map((object) => {
            return (
              <tr key={object.id}>
                  <td>{object.id}</td>
                  <td>{object.name}</td>
              </tr>
            );
        });
    }

    render() {
        return(
            <div id="item-view" className="container-fluid">
                <nav className="row text-white">
                    <div className="col-1">
                        <img className="id" src={require('./logo.png')}/>
                    </div>
                    <div className="col-4">
                        <span className="tagline">Tagline Here...</span>
                    </div>
                    <div className="col-5 text-right">
                        <span className="tagline">Tagline Here...</span>
                    </div>
                    <div className="col-2 text-right">
                        <button className="btn btn-primary d-inline-block ml-2 mt-3">Sign Out</button>
                    </div>
                </nav>
            </div>
        );
    }
}
